import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home.vue'
import motorista from './views/Motoristas.vue'

Vue.use(Router)

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/motoristas',
      name: 'motoristas',
      component: motorista
    }
  ]
})
